import React, { Component } from "react";
import "./App.css";

import background from './images/beach.JPG'
function App() {
  const style_back = {
  backgroundImage: `url(${background})`,
  backgroundSize: 'cover',
  backgroundRepeat: 'no-repeat',
  width: '100%',
  height: '900px'} 


  return (
    <div style={style_back} >
      hello
    </div>
  );
}

export default App;
